import React from 'react'

function PrimaryButton(props) {
  return (
    <>
      <button style={{backgroundColor:"#ff751f", color:"white", border:"none", paddingTop:"1em",paddingTop:"1em",paddingTop:"1em",paddingTop:"1em"}}>
        {props.text}
      </button>
    </>
  )
}

export default PrimaryButton
